import React from "react";
import "./weddingStyles.css";

const Wedding = () => {
  return (
    <div class="p-5 bg-gray-400">
    <div class="grid grid-cols-3 gap-4 grid-flow-row grid-">
      <div class="p-5 text-center bg-white row-start-1 row-end-4">A</div>
      <div class="p-5 text-center bg-white col-start-2 col-end-4">B</div>
      <div class="p-5 text-center bg-white">C</div>
      <div class="p-5 text-center bg-white">D</div>
      <div class="p-5 text-center bg-white">E</div>
    </div>
  </div>
  );
};

export default Wedding;
